function preprocessJson(jsonString) {
  // Regex to match unescaped double quotes and backslashes
  const regex = /(?:\\[\\"]|[^\\"])*"|\\./g;

  // Preprocess the JSON string
  const preprocessedJsonString = jsonString.replace(regex, (match) => {
    // If the match is a double quote or a backslash, escape it
    if (match === '"' || match === '\\') {
      return '\\' + match;
    }
    return match;
  });

